// `;

// const StyledTableCell = styled(TableCell)`
//   border-bottom: 2px solid ${({ theme }) => theme.colors.separator} !important;
// `;

export enum TableAlignment {
  left = 'left',
  right = 'right',
  center = 'center',
}

export enum TableSortDirection {
  asc = 'asc',
  desc = 'desc',
}

export type TableHeader = {
  id: string;
  alignment?: TableAlignment;
  label: string;
};

type RowCells = {
  id?: string;
  alignment?: TableAlignment;
  content: React.ReactNode;
};

export type TableRow = {
  id: string;
  collapsibleContent?: React.ReactNode;
  cells: RowCells[];
};

type Props = {
  rows: TableRow[];
  headers?: TableHeader[];
  isCollapsible?: boolean;
  className?: string;
  selectedRowIds?: Set<string>;
  sortedByHeaderId?: string;
  sortDirection?: TableSortDirection;
  onHeaderClick?: (id: string) => void;
  onRowClick?: (id: string) => void;
};

const getHeaders = (
  headers: TableHeader[],
  isCollapsible: boolean
): TableHeader[] => {
  if (!isCollapsible) {
    return headers;
  }

  return [
    ...headers,
    {
      id: 'chevron',
      label: '',
    },
  ];
};

const getRowCells = (
  cells: RowCells[],
  isSelected: boolean,
  isCollapsible: boolean
): RowCells[] => {
  if (!isCollapsible) {
    return cells;
  }

  return [
    ...cells,
    {
      alignment: TableAlignment.center,
      content: isSelected ? (
        <FixedIcon type="chevronUp" />
      ) : (
        <FixedIcon type="chevronDown" />
      ),
    },
  ];
};

export const Table = ({
  rows,
  headers,
  isCollapsible = false,
  className,
  selectedRowIds = new Set(),
  sortedByHeaderId,
  sortDirection,
  onRowClick = () => undefined,
  onHeaderClick = () => undefined,
}: Props): React.ReactElement => (
  <TableContainer component={Paper} elevation={3}>
    <TableMui className={className}>
      {/* HEADER CELLS */}
      {headers && (
        <TableHead>
          <TableRow>
            {getHeaders(headers || [], isCollapsible).map((header) => (
              <TableCell
                key={header.id}
                align={header.alignment || TableAlignment.left}>
                <TableSortLabel
                  active={sortedByHeaderId === header.id}
                  direction={sortDirection}
                  onClick={() => onHeaderClick(header.id)}>
                  {header.label}
                </TableSortLabel>
              </TableCell>
            ))}
          </TableRow>
        </TableHead>
      )}

      {/* TABLE BODY */}
      <TableBody>
        {rows.map((row) => {
          const rowCells = getRowCells(
            row.cells,
            selectedRowIds.has(row.id),
            isCollapsible
          );

          return (
            <>
              <TableRow
                hover
                key={row.id}
                selected={selectedRowIds.has(row.id)}
                onClick={() => onRowClick(row.id)}>
                {rowCells.map((c, index) => {
                  return (
                    <TableCell
                      key={c.id || index}
                      align={c.alignment || TableAlignment.left}>
                      {c.content}
                    </TableCell>
                  );
                })}
              </TableRow>

              {/* Collapsible content */}
              {isCollapsible && (
                <TableRow>
                  <TableCell
                    colSpan={rowCells.length}
                    style={{ paddingBottom: 0, paddingTop: 0 }}>
                    <Collapse
                      in={selectedRowIds.has(row.id)}
                      timeout="auto"
                      unmountOnExit>
                      <Box margin={1}>{row.collapsibleContent}</Box>
                    </Collapse>
                  </TableCell>
                </TableRow>
              )}
            </>
          );
        })}
      </TableBody>
    </TableMui>
  </TableContainer>
);
