          keepMounted
          onClose={closeMenuHandler}
          open={Boolean(anchorEl)}>
          {menuItems.map((item) => (
            <MenuItemWrapper key={item.label}>
              <MenuItem
                disabled={item.disabled}
                onClick={() => onMenuItemClick(item)}>
                {item.label}
              </MenuItem>
            </MenuItemWrapper>
          ))}
        </StyledMenu>
      </MenuWrapper>
    </ClickAwayListener>
  );
